const Users = (props) => {
  console.log(props);
  return (
    <div>
      {props.users}
      <ul>
        {props.users.map((user) => {
          <li>
            <h5>{user.name}</h5>
          </li>;
        })}
      </ul>
    </div>
  );
};

export default Users;
